import styled from "styled-components";

export const HotDjradioWrapper = styled.div`
  margin-top: 30px;

  .header {
    height: 24px;
    margin: 0 20px;
    border-bottom: 1px solid #ccc;

    .settle-singer {
      font-size: 12px;
      font-weight: bold;
      color: #333;
    }
  }

  .artist-container {
    margin: 20px 0 0 20px;
  }
`
